import React from 'react';

const ProfessionalsList = () => {

    return(
        <div className="ProfessionalsListContainer">
            <div className="filterListHeader">
                <h1>Header</h1>
            </div>

            <div className="ProfList">
                <div className="Profesional"><p> Professional 1 </p></div>
                <div className="Profesional"><p> Professional 2 </p></div>
                <div className="Profesional"><p> Professional 3 </p></div>
                <div className="Profesional"><p> Professional 4 </p></div>
            </div>
        </div>
    );

};

export default ProfessionalsList;
